def minimum_moves_to_divisible(test_cases):
    results = []
    for (n, k, a) in test_cases:
        p = defaultdict(int)
        m = 1
        for i in range(n):
            y = a[i] % k
            if y != 0:
                x = k - y
                p[x] += 1
        if len(p) == 0:
            results.append(0)
        else:
            m = 0
            for i in p.keys():
                m = max(m, (p[i] - 1) * k + i)
            results.append(m + 1)
    return results

